Determine the density of an isotropic, homogeneous density medium with compressibility factor $z$ and densities $n_1$ and $n_2$ where $n_1 > n_2$. The general expression for the density of such a medium with two different but equal densities is:

\begin{equation}
\rho = \frac{z}{1 - \beta} \rho_1 + \frac{(1-\beta)}{z} \rho_2
\end{equation}

where $\beta = \frac{n_1 - n_2}{n_1 n_2}$.

To determine the value of $\rho$ for a given set of compressibility factor, densities, and a given value of $\beta$, we first need to solve for $\rho_1$ and $\rho_2$, which we can do by substituting into the general expression:

\begin{eqnarray}
\rho &=& \frac{z}{1 - \beta} n_1 + \frac{(1-\beta)}{z} n_2 \\
\rho &\equiv& \rho_{\beta}
\end{eqnarray}

Next, we find the value of $\rho_2$ given $\rho_1$, $\rho$ and $\beta$:

\begin{eqnarray}
\rho &\equiv& \rho_{\beta} \\
\rho_{\beta} &=& \frac{z}{1 - \beta} n_1 + \frac{(1-\beta)}{z} n_2 \\
n_2 &=& \frac{\frac{(1-\beta)}{z} - \frac{z}{1 - \beta} n_1}{\frac{1}{z} + \frac{z}{1 - \beta}} \\
\rho_2 &=& \frac{z}{1 - \beta} n_1 + \frac{(1-\beta)}{z} \frac{\frac{(1-\beta)}{z} - \frac{z}{1 - \beta} n_1}{\frac{1}{z} + \frac{z}{1 - \beta}} \\
&=& \frac{z}{1 - \beta} n_1 + \frac{(1-\beta)}{z} \rho_{\beta}
\end{eqnarray}

Finally, we find the value of $\rho_1$ and substitute it into the original expression for $\rho$:

\begin{eqnarray}
\rho_2 &=& \frac{z}{1 - \beta} \rho_{\beta} \\
\rho_1 &=& \rho_{\beta} - \frac{(1-\beta)}{z} \rho_{\beta} \\
\rho &=& \frac{z}{1 - \beta} \rho_{\beta} + \frac{(1-\beta)}{z} (\rho_{\beta} - \frac{(1-\beta)}{z} \rho_{\beta}) \\
&=& \frac{z}{1 - \beta} \rho_{\beta} + \frac{\beta}{z} \rho_{\beta} \\
&=& \frac{z}{(1 - \beta)(1 + \beta)} \rho_{\beta} \\
&=& \rho_{\beta}
\end{eqnarray}

Therefore, the density of the isotropic, homogeneous density medium with compressibility factor $z$ and densities $n_1$ and $n_2$ where $n_1 > n_2$ is $\rho_{\beta}$, where $\beta = \frac{n_1 - n_2}{n_1 n_2}$.
